package org.shopping.entity;public class ShoppCar {    private int shoppCarId;    private int userId;    private int price;    private int homewearId;    private int homeWearNo;    public int getShoppCarId() {        return shoppCarId;    }    public void setShoppCarId(int shoppCarId) {        this.shoppCarId = shoppCarId;    }    public int getPrice() {        return price;    }    public void setPrice(int price) {        this.price = price;    }    public int getId() {        return shoppCarId;    }    public void setId(int shoppCarId) {        this.shoppCarId = shoppCarId;    }    public int getUserId() {        return userId;    }    public void setUserId(int userId) {        this.userId = userId;    }    public int getHomewearId() {        return price;    }    public void setHomewearId(int price) {        this.price = price;    }    public int getHomeWearNo() {        return homeWearNo;    }    public void setHomeWearNo(int homeWearNo) {        this.homeWearNo = homeWearNo;    }}